import { Role } from './Role'; 

export class User {
    userId: number;
    userName: string;
    password: string;
    active: boolean;
    recycleBin: boolean;
    activeUntil?: Date | null;
    dateCreation: Date;
    roleId: number;
    nom: string;
    prenom: string;
    mobile?: string | null;
    email?: string | null;
    role: any; // Assuming you have a Role model defined as well
    //visites: Visite[]; // Assuming Visite is another model/interface
    
  }
